import React, { useEffect, useState } from 'react'

const NewSession = ({API_URL, onShow, session, setSession}) => {
  const [exercisesSession, setExercisesSession] = useState([])
  const getExercisesSession = async (sessionId) => {
    const res = await fetch(`${API_URL}/exercisesSessions/${sessionId}`)
    const data = await res.json()

    setExercisesSession(data)
  }

  useEffect(() => {
    getExercisesSession(1)
  }, [API_URL])

  return (
    <div id="carouselExampleIndicators" clasName="carousel slide" data-ride="carousel">
      <ol className="carousel-indicators">
        {exercisesSession.map(exerciseSession => (
          <li key={exerciseSession.id} data-target="#carouselExampleIndicators" 
          data-slide-to={exerciseSession.id} ></li>
        ))}
      </ol>

      <div className="carousel-inner">
        {exercisesSession.map(exerciseSession => (
          <div key={exerciseSession.id} className="carousel-item active">
            Series: {exerciseSession.series},
            Reps: {exerciseSession.minReps} - {exerciseSession.maxReps},
            Descanso: {exerciseSession.rest},
            RIR: {exerciseSession.RIR}
          </div>
        ))}
      </div>

      <a className="carousel-control-prev" href="#carouselExampleIndicators" role="button" data-slide="prev">
        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
        <span className="sr-only">Previous</span>
      </a>
      <a className="carousel-control-next" href="#carouselExampleIndicators" role="button" data-slide="next">
        <span className="carousel-control-next-icon" aria-hidden="true"></span>
        <span className="sr-only">Next</span>
      </a>
    </div>
  )
}

export default NewSession
